  false,\n\t\"url\": null,\n\t\"notes\": \"Near Buckeye, Arizona, six evapotranspirometers
  were installed in 1959 and planted to saltcedar. This is a cooperative endeavor
  by the U. S. Bureau of Reclamation and the U.S. Geological Survey to determine the
  use of water by this phreatophyte. During the spring and summer of 1961 and 1962
  growth (increase in length of branches) and development (increase in number of side
  shoots on these branches) were observed and recorded. The data so obtained could
  be correlated with the measured use of water and with the accessibility to water.
  Results of these studies, are the following : Saltcedar does not grow or develop
  in this area when the depth to water is 18 feet or more. Saltcedar tanks use more
  water with higher water tables but there are no significant differences in growth
  or development if the depth to water is 9 feet or less. Saltcedar grows and develops
  fast in the early spring with rapid increase in use of water; by mid-summer both
  growth and development level off sharply with a drastic reduction in water use,
  even though accessibility remains the same.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
